/* eslint-disable prettier/prettier */
import styled from 'styled-components';
import {FiHeart} from 'react-icons/fi';

const TrackSide = () => (
        <Wrapper>
            <Heading>
                Top Tracks
            </Heading>
            <Table>
                <tr>
                    <th>Sheikh</th>
                    <th>Title</th>
                    <th>Plays</th>
                    <th>Like</th>
                </tr>
                <tr>
                    <td>Sheikh Jafar</td>
                    <td>Mata Muminai</td>
                    <td>10k</td>
                    <td><FiHeart color="#ea3cs3"/></td>
                </tr>
            </Table>
        </Wrapper>
    )
const Wrapper = styled.div`
padding-top:14px;
font-family:'Source Sans Pro',sans-serif;
`
const Heading = styled.h2`

color:hsl(90, 100%, 27%);
font-size:24px;
font-weight:bold;
font-family:inherit;
`
const ListItems = styled.li`
list-style:none;
display:flex;
justify-content:space-between;
margin-bottom:24px;
p{
    color:hsl(0,0%,49%);
}
h3{
    color:hsl(0,0%,45%);
}
`
const Table = styled.div`
widht:100%;

td, th {
  border: 1px solid #dddddd;
  text-align: left;
  padding: 8px;
}

tr:nth-child(even) {
  background-color: #dddddd;
}
`
const TopBar = styled.ol`
padding-right:30px;

`
export default TrackSide;
